Time Trax
&quot;It began in the future. A time machine called TRAX, criminals who vanish, and a lawman who must pursue into the past. Now he is among us, a special breed of man. He has one weapon and a computer called Selma. With her, he will travel through our world, searching for fugitives from his own, knowing he cannot go home until he has found them all. His name is Darien Lambert, and this is his story.&quot;

While this is a dvdrip, keep in mind this show is from 1993-1994 era and this is the best available (aside from actual 1:1 dvd copy), as earlier releases were from TV recordings on VHS.  i renamed them all and pulled metadata info so it can be loaded in xbmc/kodi or some other media players.  All files should be in mp4 format.

Enjoy and share!


